(1924, 343, '_form', '<div class="row"> \n                <div class="col-sm-6">\n                    <div class="form-group">\n                        <label for="first_name">First name</label>\n                        [text* first_name id:first_name class:form-control]\n                    </div>\n                </div>\n                <div class="col-sm-6">\n                    <div class="form-group">\n                        <label for="last_name">Last name</label>\n                        [text* last_name id:last_name class:form-control]\n                    </div>\n                </div>\n                <div class="col-sm-6">\n                    <div class="form-group">\n                        <label for="email_addr">Email address</label>\n                        [email* email_addr id:email_addr class:form-control]\n                    </div>\n                </div>\n                <div class="col-sm-6">\n                    <div class="form-group">\n                        <label for="phone_no">Phone number</label>\n                       [number* phone_no id:phone_no class:form-control]\n                    </div>\n                </div>\n                <div class="col-sm-6">\n                    <div class="form-group">\n                        <label for="business_name">Business name</label>\n                        [text* business_name id:business_name class:form-control]\n                    </div>\n                </div>\n                <div class="col-sm-6">\n                    <div class="form-group">\n                        <label for="title">Title</label>\n                        [text* title id:title class:form-control]\n                    </div>\n                </div>\n                <div class="col-sm-12 margin-top">\n                    <div class="form-group">\n                        <label for="message">Your message</label>\n                        [textarea* message id:message class:form-control]\n                    </div>\n                </div>\n            </div>\n            <div class="row">\n                <div class="col-xs-12">\n                    <h3 class="heading-parter-type">Partner Type</h3>\n                </div>\n                <div class="col-xs-12 col-sm-6 col-md-5 col-lg-4 partner-type">\n                <div class="form-group">\n	 [radio sales use_label_element default:1 "Distribution Sales Partner" "Referral Sales Partner" "Financial Platform Sales Partner" "I''m not sure"]\n<a href="javascript:void(0);" data-toggle="tooltip" title="Duis id efficitur tortor, sed pharetra nibh!" class="question-mark"></a>\n                </div>\n                </div>\n            </div>\n            <div class="row">\n                <div class="col-xs-12">\n                    <h3 class="heading-beacome-partner">Looking to become an Affiliate Partner?</h3>\n                    <p>Join via the <a href="javascript:void(0);" class="know-more">CC Affiliate Network</a></p>\n                </div>\n            </div>\n            <div class="row">\n                <div class="col-xs-12">\n                    <div class="join-us">\n                        [submit class:btn class:btn-blue-bg class:action-btn "JOIN"]\n                    </div>\n                </div>'),
