(6111, 208, 'wpcf-about-us-heading', 'Since 1998,CAN Capital has helped<br id="blank" />small businesses succeed.'),
(6112, 208, 'wpcf-about-us-description', '<p id="blank">We positioned ourselves in an economy where traditional lenders made it cumbersome and difficult for small businesses to get the working capital they needed. Our solutions to this challenge made us the first of our kind in the category.</p>\r\n<p id="blank">Almost two decades later, our vision remains the same, while our innovative spirit drives us to continually improve our offerings for our customers and partners</p>\r\n<p id="blank">We believe the best thing we can do for small business owners is get them back to business as quickly as possible. Thats why were committed to offering an easy application and approval process, with seasoned professionals who have the expertise to evaluate needs and provide access to the best funding options, fast</p>\r\n<p id="blank">Our confidence in small businesses across the country drives our mission to help them realize their greatest possibilities. For tenacious entrepreneurs, CAN Capital is the time-tested partner to help them take on challenges and experience success.</p>'),
